import React from 'react';
import HomeImage from '../images/Home.png';
import SearchImage from '../images/Search.png';

export const Home = () => {
  return (
    <div>
        <img className="home-image" src={HomeImage} />
        <img className="search-image" src={SearchImage} />
    </div>
  )
}
